import Login from './Login'
import {BrowserRouter, Route, Routes} from 'react-router-dom'
import Bar from './Bar'

const App=()=>{
  return (
     <>
     <BrowserRouter>
        {(localStorage.getItem("user"))?
        <><Bar/></>:<></>
        }
        <Routes>
        <Route path="/" exact element={<Login/>}/>
        </Routes>
      </BrowserRouter>
     </>
  );
}

export default App;
